function copyToClipboard(text) {
    const dummy = window.document.createElement("textarea");
    window.document.body.appendChild(dummy);
    dummy.value = text;
    dummy.select();
    window.document.execCommand("copy");
    window.document.body.removeChild(dummy);
}

